(1, 'Chuyển Nhượng Căn Hộ Masteri Thảo Điền Tháp T2', 'chuyen-nhuong-can-ho-masteri-thao-dien-thap-t2', 1, 'images/uploads/images/masterithaodien/thapt2/1.jpg', 'images/uploads/images/masterithaodien/thapt2/2.jpg;images/uploads/images/masterithaodien/thapt2/4.jpg;images/uploads/images/masterithaodien/thapt2/5.jpg;images/uploads/images/masterithaodien/IMG-dc5abb7205fdd896c5a49274c3fdabbf-V.jpg;images/uploads/images/masterithaodien/IMG-2353bf7c51abdbbf1d2543092dd8a357-V(1).jpg;images/uploads/images/masterithaodien/IMG-67308f78b304e7ab3aa149befdcb2ebf-V(1).jpg', '<p>\r\n	Full Nội Thất Như Hình &ndash; View Đẹp Thoáng &ndash; Tầng Cao &ndash; Liên Hệ: 0902 806 679 (Mr Hưng)\r\n</p>', '<p style=\"line-height:1.5;\">\r\n	<span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"font-size:18px;\"><img alt=\"\" height=\"16\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f87/1/16/1f340.png\" width=\"16\">Chuyển nhượng căn hộ Masteri Thảo Điền tháp T2&nbsp;full nội thất &ndash; view đẹp thoáng<br>\r\n	<img alt=\"\" height=\"16\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f51/1/16/1f449.png\" width=\"16\">Full Nội thất, căn góc, bếp mở, layout phòng khách thoáng, decorate nội thất đẹp view Xa Lộ Hà Nội, hướng Đông Bắc, tránh nắng đã có sổ hồng.<br>\r\n	Tiện ích cao cấp: Vincom Mega Mall, Coffe shop, Hồ bơi, công viên, phòng Gym,&hellip;<br>\r\n	<img alt=\"\" height=\"16\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/fe8/1/16/1f451.png\" width=\"16\">&nbsp;Giá Bán: 3tỷ9<br>\r\n	<img alt=\"\" height=\"16\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f4d/1/16/1f4de.png\" width=\"16\">Liên Hệ: 0902 806 679 (Mr Hưng)<br>\r\n	Hình ảnh thực tế căn hộ:&nbsp;</span></span>\r\n</p>\r\n\r\n<p style=\"text-align: center;\">\r\n	&nbsp;\r\n</p>\r\n\r\n<p style=\"text-align: center;\">\r\n	&nbsp;\r\n</p>\r\n\r\n<p style=\"text-align: center;\">\r\n	&nbsp;\r\n</p>\r\n\r\n<p style=\"text-align: center;\">\r\n	&nbsp;\r\n</p>\r\n\r\n<p style=\"text-align: center;\">\r\n	&nbsp;\r\n</p>\r\n\r\n<p style=\"text-align: center;\">\r\n	&nbsp;\r\n</p>\r\n\r\n<p style=\"text-align: center;\">\r\n	&nbsp;\r\n</p>', 2, 2, 0, NULL, '86', 1, 0, NULL, 'NDH-1837', '3,9', 1, 1, '2018-10-10 12:51:00', '2018-10-18 09:32:45', 1, 3, 1, 54, NULL),
